import React from 'react';
import { Box, Button, Typography } from '@mui/material';
import { ReactTyped } from 'react-typed';
import ParticlesComponent from './particles/particlesComponent';
import './particles/particles.css'
import './styles/home.css'; 
import '../App.css';

const HomeText = () => {
	return (
		<div className='home_text_container'>
      <div className='home_text'>
        <p style={{fontSize: '1em'}}> Hey, I'm </p>
        <p class="header-introduction"> <strong>Nelson Rodriguez</strong> </p>

        {/**<Typewriter 
          text={"The quick brown fox jumps over the lazy dog"} 
          delay={100} 
          infinite={true}
        />**/}

        <ReactTyped 
          strings={[
            "Software Engineer and Developer with an eye for Design",
            "Algorithms Expert and Problem Solver",
            "CS Alumni and Ramblin Wreck from Georgia Tech",
            "Currently learning AI/ML in my free time",
            "Hardware Enthusaist and Coffee Connosieur",
            "Avid Runner, Passionate Gamer, and Lover of Animals",
          ]} 
          typeSpeed={50} 
          backDelay={2000}
          cursorChar='|'
          loop={true}
        />

        <ParticlesComponent id='home_particles_component'/>

        <p class='header-information'>Hey, I'm Nelson, A<strong> Developer </strong> {/**<a class="company">@Meta</a>**/} and
            <a> </a>
            <a class="link-parchment" target="_blank" rel="noopener noreferrer" href="https://www.parchment.com/u/award/cdc63a097762a059103a9b3ce857a15e">CS Alum</a>
            <a> </a>
            <a class="link-gatech" target="_blank" rel="noopener noreferrer" href="https://www.cc.gatech.edu/">
              <strong class="georgia-tech">@Georgia Tech</strong>
            </a> 
        </p>
        <Box className="about_me" sx={{margin: '30px 0'}}>
          <Button variant='contained'size='large' onClick='/scrollToAboutMe' color='inherit'
            sx={{
              backgroundColor: 'var(--primary-color-dark)',
              color: 'var(--primary-color-light)', 
              '&:hover': {
                backgroundColor: 'grey', 
                color: 'white'
              },
              fontFamily: 'var(--font-family-ibm-plex-mono)', 
              textTransform: 'none', 
            }}>
            <Typography variant='h6' align='center' fontWeight={300}>
              About Me!
            </Typography>
          </Button>
        </Box>

      </div>
    </div>
	)
}

export default HomeText;
